        "description": "Watch the exclusive behind the scenes on Red Bull TV üëâ https://www.redbull.com/int-en/episodes/the-ultimate-run-s1-e2\n\n‚ÄúSometimes my mind goes kind of crazy about skiing and I ask myself, what if...?‚Äù - Markus Eder\n\nWhat if you could link every powder turn, every rail, every cliff drop, every comp run and every kicker nailed into one ultimate run? Well, Markus Eder did just that in ‚ÄòThe Ultimate Run‚Äô!\n\nThis is Markus‚Äô Opus Magnum, a medley of face shots, massive tricks and even bigger drops, which was documented by Innsbruck based production company Legs of Steel over the past two years.\n\nMarkus has been visualizing the ultimate run since 2015. It may look like a simple undertaking in the final editbut for arguably the most versatile skier on the planet, it meant taking his skill levels in every form and style of contemporary freeskiing to the next level.\n\n‚ÄúAll aspects of freeskiing have fascinated me since the beginning‚Äù, states Markus.\n\nThe Ultimate Run kicks off on the lofty extremities of Zermatt as Markus drops into a sheer expanse of powder, before shredding his way through glacial blocks the size of buses, jumping off ice cliffs and then slips into the belly of the glacier, only to reappear above his home resort of Klausberg. Carving fields of fresh powder he joins a session with his buddies at his local snowpark, before boosting back off into the backcountry for some more face shots. The firecrackers keep on popping as he enters the snow covered architecture of Taufer castle and a mining museum. As the sun sets over the mountains Markus slides out onto the valley floor, six years of dream skiing condensed into ten minutes of pure joy and adrenaline. \n\nThis edit took over 90 days to film, entirely in the Alps in Markus‚Äô home region. ‚ÄúThe Ultimate Run is Markus‚Äô dream project,‚Äù says Tobi Reindl from Legs of Steel, ‚Äúand it also became one of the biggest and most thrilling projects we have done so 